import{_ as e}from"./chunks/cube_yellow_hero.BLIAdqkc.js";import{_ as t,a as r}from"./chunks/cube_ports_usb_sdcard.DjqeRsN_.js";import{_ as i}from"./chunks/cube_ports_debug.rfpatbdm.js";import{_ as o,c as a,o as l,ab as n}from"./chunks/framework.CUflZczI.js";const P=JSON.parse('{"title":"CubePilot Cube Yellow Flight Controller","description":"","frontmatter":{},"headers":[],"relativePath":"zh/flight_controller/cubepilot_cube_yellow.md","filePath":"zh/flight_controller/cubepilot_cube_yellow.md"}'),s={name:"zh/flight_controller/cubepilot_cube_yellow.md"},u=n('<h1 id="cubepilot-cube-yellow-flight-controller" tabindex="-1">CubePilot Cube Yellow Flight Controller <a class="header-anchor" href="#cubepilot-cube-yellow-flight-controller" aria-label="Permalink to &quot;CubePilot Cube Yellow Flight Controller&quot;">​</a></h1><div class="warning custom-block"><p class="custom-block-title">PX4 does not manufacture this (or any) autopilot. Contact the <a href="https://cubepilot.org/#/home" target="_blank" rel="noreferrer">manufacturer</a> for hardware support or compliance issues.</p></div><p>The Cube Yellow flight controller is a flexible autopilot intended primarily for manufacturers of commercial systems.</p><p><img src="'+e+'" alt="Cube Yellow"></p><p>The controller is designed to be used with a domain-specific carrier board in order to reduce the wiring, improve reliability, and ease of assembly. For example, a carrier board for a commercial inspection vehicle might include connections for a companion computer, while a carrier board for a racer could includes ESCs for the frame of the vehicle.</p><p>Cube includes vibration isolation on two of the IMU&#39;s, with a third fixed IMU as a reference / backup.</p><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>The manufacturer <a href="https://docs.cubepilot.org/user-guides/autopilot/the-cube-module-overview" target="_blank" rel="noreferrer">Cube Docs</a> contain detailed information, including an overview of the <a href="https://docs.cubepilot.org/user-guides/autopilot/the-cube-module-overview#differences-between-cube-colours" target="_blank" rel="noreferrer">Differences between Cube Colours</a>.</p></div><h2 id="主要特性" tabindex="-1">主要特性 <a class="header-anchor" href="#主要特性" aria-label="Permalink to &quot;主要特性&quot;">​</a></h2><ul><li>32bit STM32F777VI (32bit <a href="https://en.wikipedia.org/wiki/ARM_Cortex-M#Cortex-M7" target="_blank" rel="noreferrer">ARM Cortex M7</a>, 400 MHz, Flash 2MB, RAM 512 KB).</li><li>32 bit STM32F103 failsafe co-processor </li><li>14 PWM / Servo outputs (8 with failsafe and manual override, 6 auxiliary, high-power compatible)</li><li>Abundant connectivity options for additional peripherals (UART, I2C, CAN)</li><li>Integrated backup system for in-flight recovery and manual override with dedicated processor and stand-alone power supply (fixed-wing use)</li><li>Backup system integrates mixing, providing consistent autopilot and manual override mixing modes (fixed-wing use)</li><li>Redundant power supply inputs and automatic failover</li><li>External safety switch</li><li>Multicolor LED main visual indicator</li><li>High-power, multi-tone piezo audio indicator</li><li>microSD card for high-rate logging over extended periods of time</li></ul><p><a id="stores"></a></p><h2 id="在哪里买" tabindex="-1">在哪里买 <a class="header-anchor" href="#在哪里买" aria-label="Permalink to &quot;在哪里买&quot;">​</a></h2><ul><li><a href="https://www.cubepilot.com/#/reseller/list" target="_blank" rel="noreferrer">Reseller list</a></li></ul><h2 id="组装" tabindex="-1">组装 <a class="header-anchor" href="#组装" aria-label="Permalink to &quot;组装&quot;">​</a></h2><p><a href="./../assembly/quick_start_cube.html">Cube Wiring Quickstart</a></p><h2 id="产品规格" tabindex="-1">产品规格 <a class="header-anchor" href="#产品规格" aria-label="Permalink to &quot;产品规格&quot;">​</a></h2><ul><li><strong>处理器:</strong><ul><li>STM32F777VI (32bit <a href="https://en.wikipedia.org/wiki/ARM_Cortex-M#Cortex-M7" target="_blank" rel="noreferrer">ARM Cortex M7</a>)</li><li>400 MHz</li><li>512 KB MB RAM</li><li>2 MB Flash</li></ul></li><li><strong>Failsafe co-processor:</strong><ul><li>STM32F100 (32bit <em>ARM Cortex-M3</em>)</li><li>24 MHz</li><li>8 KB SRAM</li></ul></li><li><strong>Sensors:</strong> (all connected via SPI) <ul><li><strong>Accelerometer:</strong> (3) ICM20948, ICM20649, ICM20602</li><li><strong>Gyroscope:</strong> (3) ICM20948, ICM20649, ICM20602</li><li><strong>Compass:</strong> (1) ICM20948</li><li><strong>Barometric Pressure Sensor:</strong> (2) MS5611</li></ul></li><li><strong>Operating Conditions:</strong><ul><li><strong>Operating Temp:</strong> -10C to 55C</li><li><strong>IP rating/Waterproofing:</strong> Not waterproof</li><li><strong>Servo rail input voltage:</strong> 3.3V / 5V</li><li><strong>USB port input:</strong><ul><li>Voltage: 4V - 5.7V</li><li>Rated current: 250 mA</li></ul></li><li><strong>POWER:</strong><ul><li>Input voltage: 4.1V - 5.7V</li><li>Rated input current: 2.5A</li><li>Rated input/output power: 14W</li></ul></li></ul></li><li><strong>尺寸:</strong><ul><li><strong>Cube:</strong> 38.25mm x 38.25mm x 22.3mm</li><li><strong>Carrier:</strong> 94.5mm x 44.3mm x 17.3mm</li></ul></li><li><strong>接口</strong><ul><li>IO Ports: 14 PWM servo outputs (8 from IO, 6 from FMU)</li><li>5x UART (serial ports), one high-power capable, 2x with HW flow control</li><li>2x CAN (one with internal 3.3V transceiver, one on expansion connector)</li><li><strong>R/C inputs:</strong><ul><li>Spektrum DSM / DSM2 / DSM-X® Satellite compatible input</li><li>Futaba S.BUS® compatible input and output</li><li>PPM-SUM signal input</li></ul></li><li>RSSI (PWM or voltage) input</li><li>I2C</li><li>SPI</li><li>3.3v ADC input</li><li>Internal microUSB port and external microUSB port extension</li></ul></li></ul><h2 id="引脚和原理图" tabindex="-1">引脚和原理图 <a class="header-anchor" href="#引脚和原理图" aria-label="Permalink to &quot;引脚和原理图&quot;">​</a></h2><p>Board schematics and other documentation can be found here: <a href="https://github.com/proficnc/The-Cube" target="_blank" rel="noreferrer">The Cube Project</a>.</p><h2 id="ports" tabindex="-1">Ports <a class="header-anchor" href="#ports" aria-label="Permalink to &quot;Ports&quot;">​</a></h2><h3 id="top-side-gps-telem-etc" tabindex="-1">Top-Side (GPS, TELEM etc) <a class="header-anchor" href="#top-side-gps-telem-etc" aria-label="Permalink to &quot;Top-Side (GPS, TELEM etc)&quot;">​</a></h3><p><img src="'+t+'" alt="Cube Ports - Top (GPS, TELEM etc) and Main/AUX"></p><h2 id="serial-port-mapping" tabindex="-1">Serial Port Mapping <a class="header-anchor" href="#serial-port-mapping" aria-label="Permalink to &quot;Serial Port Mapping&quot;">​</a></h2><table><thead><tr><th>UART</th><th>设备</th><th>Port</th></tr></thead><tbody><tr><td>USART2</td><td>/dev/ttyS0</td><td>TELEM1 (flow control)</td></tr><tr><td>USART3</td><td>/dev/ttyS1</td><td>TELEM2 (flow control)</td></tr><tr><td>UART4</td><td>/dev/ttyS2</td><td>GPS1</td></tr><tr><td>USART6</td><td>/dev/ttyS3</td><td>PX4IO</td></tr><tr><td>UART7</td><td>/dev/ttyS4</td><td>CONSOLE/ADSB-IN</td></tr><tr><td>UART8</td><td>/dev/ttyS5</td><td>GPS2</td></tr></tbody></table><h3 id="debug-ports" tabindex="-1">Debug Ports <a class="header-anchor" href="#debug-ports" aria-label="Permalink to &quot;Debug Ports&quot;">​</a></h3><p><img src="'+i+'" alt="Cube Debug Ports"></p><h3 id="usb-sdcard-ports" tabindex="-1">USB/SDCard Ports <a class="header-anchor" href="#usb-sdcard-ports" aria-label="Permalink to &quot;USB/SDCard Ports&quot;">​</a></h3><p><img src="'+r+'" alt="Cube USB/SDCard Ports"></p><h2 id="编译固件" tabindex="-1">编译固件 <a class="header-anchor" href="#编译固件" aria-label="Permalink to &quot;编译固件&quot;">​</a></h2><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>Most users will not need to build this firmware! It is pre-built and automatically installed by <em>QGroundControl</em> when appropriate hardware is connected.</p></div><p>To <a href="./../dev_setup/building_px4.html">build PX4</a> for this target:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code"><code><span class="line"><span>make cubepilot_cubeyellow</span></span></code></pre></div><h2 id="issues" tabindex="-1">Issues <a class="header-anchor" href="#issues" aria-label="Permalink to &quot;Issues&quot;">​</a></h2><p>CAN1 and CAN2 silk screen on the Cube are flipped (CAN1 is CAN2 and vice versa).</p><h2 id="further-information-documentation" tabindex="-1">Further Information/Documentation <a class="header-anchor" href="#further-information-documentation" aria-label="Permalink to &quot;Further Information/Documentation&quot;">​</a></h2><ul><li><a href="./../assembly/quick_start_cube.html">Cube 快速接线指南</a></li><li>Cube Docs (Manufacturer): <ul><li><a href="https://docs.cubepilot.org/user-guides/autopilot/the-cube-module-overview" target="_blank" rel="noreferrer">Cube Module Overview</a></li><li><a href="https://docs.cubepilot.org/user-guides/autopilot/the-cube-user-manual" target="_blank" rel="noreferrer">Cube User Manual</a></li><li><a href="https://docs.cubepilot.org/user-guides/carrier-boards/mini-carrier-board" target="_blank" rel="noreferrer">Mini Carrier Board</a></li></ul></li></ul>',35),d=[u];function c(p,h,b,m,g,f){return l(),a("div",null,d)}const v=o(s,[["render",c]]);export{P as __pageData,v as default};
